import React from 'react';
import { Link } from 'react-router-dom';

import pdf1 from './DIODES.pdf';

import Pdf_reader from './Pdf_reader';

class Notes extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			pdf: undefined,
		};
	}
	onNotesClick = () => {
		this.setState({ pdf: pdf1 });
	};
	render() {
		return (
			<div>
				<h1>Class notes 1</h1>
				<button onClick={this.onNotesClick}>Notes 1</button>
				{this.state.pdf && <Pdf_reader note={this.state.pdf} />}
			</div>
		);
	}
}

export default Notes;
